  "info": {
    "title": "Prisma Cloud Code Security API",
    "version": "Latest",
    "description": "The Prisma Cloud Code Security API enables you to check your Infrastructure-as-Code (IaC) templates\nagainst Prisma Cloud out-of-the-box and custom security policies.\n\nThe Code Security API provides functionality in the following areas: \n\n* [Repositories](/api/cloud/code/code-security#tag/Repositories)\n* [Scans](/api/cloud/code/code-security#tag/Scans)\n* [Suppression rules](/api/cloud/code/code-security#tag/Suppressions) \n* [Code Security policy violations](/api/cloud/code/code-security#tag/CodeErrors)\n* [Code Security policy violation fixes](/api/cloud/code/code-security#tag/CodeFixes) \n\nUse the [CSPM Policy API](/api/cloud/cspm/policy) to create and manage \nCode Security build policies.\n\n\nSee [Prisma Cloud Code Security](https://docs.paloaltonetworks.com/prisma/prisma-cloud/prisma-cloud-admin-code-security.html) \nfor more information.\n",
    "contact": {}
  },
